import React,{Component} from 'react';
import axios from 'axios';
class Testtable extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      data:'',
      geturl:'http://localhost:9082/api/test',
      headers:''
      // deleteurl='',
     }
  }
componentDidMount(){
  axios.get(this.state.geturl)
  .then(res=>{
    console.log(typeof(res));
    this.setState({data:(res.data.message)})
    this.setState({headers:Object.keys(res.data.message)})
  })
}
  render() { 
    console.log(this.state.headers);
    return (  
      <div>
        
        { this.state.data.length > 0 ? 
        <table>
          <thead>
          {
            this.state.headers.map(
(item,pos)=>
            {
              <th>{item}</th>         
            }
            )
          }
          </thead>
          <tbody>
            {
              this.state.data.map(item=>{<tr>
                {this.state.headers.map(ele=>{
                 return(<td>{item[ele]}</td>)   
                })}
              </tr>})
            }
          </tbody>
        </table>
        : null
        }
      </div>

    );
  }
}
 
export default Testtable;
